(function(){
    //console.log('load : templateValid.js');
    var validCompBase = { // validCompBase
        '__keywords' : [
            // {nm:'id',            tp:'[default property]'},
            {nm:'root',          tp:'[default property]'},
            {nm:'child',         tp:'[default property]'},
            {nm:'declare',       tp:'[keyword]'},
            {nm:'properties',    tp:'[keyword]'},
            {nm:'methods',       tp:'[keyword]'},
            {nm:'controls',      tp:'[keyword]'},
            {nm:'events',        tp:'[keyword]'},
            {nm:'watches',       tp:'[keyword]'},
            {nm:'initialize',    tp:'[keyword]'},
            {nm:'propertyChange',tp:'[keyword]'},
            {nm:'elementChange', tp:'[keyword]'},
            {nm:'dsoDataChange', tp:'[keyword]'},
            {nm:'destroy',       tp:'[keyword]'},
            {nm:'watch',         tp:'[default method]'},
            {nm:'unwatch',       tp:'[default method]'},
            {nm:'init',          tp:'[instance method]'},
            {nm:'propChange',    tp:'[instance method]'},
            {nm:'propChangeRO',  tp:'[instance method]'},
            {nm:'elemChange',    tp:'[instance method]'},
            {nm:'dataChange',    tp:'[instance method]'},
            {nm:'free',          tp:'[instance method]'},
            {nm:'execMethod',    tp:'[instance method]'},
            {nm:'execCtrl',      tp:'[instance method]'}
        ],
        '__checkDupAndKey' :[
            'properties','methods','events'
        ],
        declare:{
            'tagName'       : '',
            'template'      : '',
            'replace'       : true,
            'noneVisible'  : true,
            'isDataSource' : true
        },
        properties:{
            '__NorM'     : {'type':typeof(''),readonly:false,defaultValue:'__alltype'}
        },
        methods:{
            /*'method1' : {
             'argumentCheck'  : true,
             'argumentDefine' : {
             'arg1' : { 'type':typeof(''), defaultValue: null},
             'arg2' : { 'type':typeof(''), defaultValue: '1-arg2def'},
             'arg3' : { 'type':typeof(''), defaultValue: '1-arg3def'}
             },
             'methodCode' : function($args) {
             console.log(this.id+'.method1() : '+$args.arg1+' / '+$args.arg2+' / '+$args.arg3);
             //this.myFunction(); // Success
             //my2();             // is ERROR
             }
             }*/
        },
        controls:{
            /*'ctrl1':{
             'click':function($evt){
             alert('['+this.id+'].ybtn1 click : this.value1 = "'+this.value1+'"');
             }
             }*/
        },
        events:{
        },
        watches:{
        },
        initialize:function($yelem,$attrs) {},
        propertyChange:function(propName,oldValue,newValue) {},
        elementChange:function($yelem,$elem,propName,oldValue,newValue) {},
        dsoDataChange:function(dso,dsoName,fldName,oldValue,newValue) {},
        destroy:function($elem,$attrs) {}
    };

    var validMessages = {
        validOk : function(a,o,c) {
            // c.push('['+a+'] 컴포넌트가 등록되었습니다.');
            c.push('['+a+'] The component is registered.');
            c.push('[properties]'); // 속성
            c.push(o['properties']);
            c.push('[methods]'); // 메소드
            c.push(o['methods']);
            c.push('[events]'); // 이벤트
            c.push(o['events']);
        },
        validTitle : function (a,b) {
            // return '['+a+'] 컴포넌트 등록 중 '+b+'개의 오류가 발생하여, 등록되지 않았습니다.';
            return '['+a+'] component :'+b+' errors occurred during component registration, not registered.';
        },
        notObject : function (a) {
            // return '['+typeof(a)+'] 객체 유형은 옳바른 컴포넌트 base 가 아닙니다.';
            return '['+typeof(a)+'] Objecttype is not a valid component base.';
        },
        dupTag : function(a) {
            // return 'declare.tagName 에 설정된 "'+a+'" 는 이미 등록된 custom tag 입니다.';
            return '"'+a+'" set in [declare.tagName] is already a registered custom tag.';
        },
        notFound : function(a,b) {
            // return a+' 에 "'+b+'" 항목이 존재하지 않습니다. 컴포넌트 템플릿에 기본 항목은 반드시 존재하여야 합니다.';
            return 'The entry "'+b+'" does not exist in '+a+'. A default entry must exist in the component template.';
        },
        notSetted : function(a,b) {
            // return a+' 의 필수 입력항목인 '+b+'의 값이 없습니다.';
            return 'There is no value for '+b+', a required entry in '+a+'.';
        },
        typeMiss : function(a,b,c) {
            // return a+' 의 항목의 자료형태가 "'+b+'"(이)가 아닙니다. (현재 유형:"'+c+'")';
            return 'The data type of '+a+' is not "'+b+'". (Current type:"'+c+'")';
        },
        isKeyword : function(a,b) {
            // return a+' 의 항목 이름은 '+b+' 이므로 사용할 수 없는 이름입니다.';
            return 'The item name in '+a+' is '+b+', which is not available.';
        },
        duplex : function(a,b,c) {
            // c.push('속성(메소드)명 "'+a+'"(이)가 중복되었습니다.속성,메소드들의 명칭은 서로 달라야합니다.');
            c.push('Attribute(method) name "'+a+'" is duplicated. The name of properties and methods must be different.');

            // c.push('최초 선언 : '+b[0]);
            c.push('First declaration : '+b[0]);

            for (var i=1;i<b.length; i++) {
                // c.push('중복 에러 : '+b[i]);
                c.push('Duplicate error : '+b[i]);
            }
        }
        /* // 임의로 추가가 가능하도록 하기위해서 검사하지 않음 //
         unknown : function(a,b) {
         return a+' 의 항목 이름 "'+b+'"는 알 수 없는 이름입니다.\n'+
         '해당 이름은 컴포넌트 템플릿에 정의되어 있지 않습니다.'
         }
         */
    };

    $wai.core.setValidCompBase(validCompBase,validMessages);
})();

