// waiPageInit.js
$(document).ready(function(){
    $wai.log.printGroup(true,6);

    function PrepareRuntimePage() {
        let html = $(document.body).parent()[0];
        let RW = html.getAttribute('runWidth');
        let RH = html.getAttribute('runHeight');
        if (parseInt(RW) > 0) html.style.width = RW;
        if (parseInt(RH) > 0) html.style.height = RH;
    }
    let isWaiIDE;
    try {
        let topPage   = (window.top.location.pathname+'').split("/").pop();
        isWaiIDE   = (topPage == 'waiIDE.html')||(topPage == 'waiHtmlEditor.html')||(topPage == 'waiHtmlEditorMain.html');
    } catch(e) {
        isWaiIDE  = true;
    }
    if (!isWaiIDE) PrepareRuntimePage();

    function PrepareJsonData( tarTags ) {
        var i,j;
        for (i=0;i<tarTags.length;i++) {
            var Tags = $(document.body).find(tarTags[i]);
            for (j=0;j<Tags.length;j++) {
                $wai.core.JsonDataBuffer.add(Tags[j]);
            }
        }
    }
    PrepareJsonData(['codecombo','grid','chart']);
    //$wai.core.JsonDataBuffer.printConsole();

    $wai.core.generateDataServices();
    $wai.core.generateNormalTags();
    $wai.core.generateAll();

    $wai.core.JsonDataBuffer.clear();
    $wai.rtl.anchor.set();
    if($wai.rtl.metaCodeManager !== undefined){
        $wai.rtl.metaCodeManager.set();
    }
    if($wai.rtl.multiLangManager !== undefined){
        $wai.rtl.multiLangManager.set();
    }

    if (waiJSON !== undefined) {
        waiJSON.generateDSO();
    }
});

